window.bookSummaryJSON = "<p>A new chapter. A hidden threat.</p> <p>Constance has her mother back, but it came at a high price. Her familiar lied to her. Her grandmother's gone. And her boyfriend has given her space—space she isn't sure she needs. She concedes by taking her first official mission for the Faction, hoping to solve a few questions of her own:</p> <p>- Where is Morgana?</p> <p>- Can she help her mother recover her memory?</p> <p>- And will they ever be safe?</p> <p>While she's gone, there's a string of mysterious crimes in Creel Creek, ultimately leading to a botched burglary and a murder. The perpetrators of which share the same curious trait—they don't remember committing these crimes.</p> <p>Dave needs help. But will the mysteries bring them closer together or push them farther apart?</p>"; 
